import $axios from '../helpers/axios-instance';
import axios from 'axios';

//const baseUrl = process.env.API_ADMIN_URL;
const baseUrl = 'http://localhost:8000';

export default {

  getResultsByDaysWon(token) {
    console.log(token);


      const headers = {
        'Access-Control-Allow-Origin': '*',
        'Content-Type': 'application/json',
        'Access-Control-Allow-Credentials':false,
        Accept: 'application/json',
        'Authorization:' : `Bearer ${token}`,
        baseURL: baseUrl
      }

    return $axios.get(`/api/v1/Guess/GetResultsByDaysWon`, { headers: headers });
  },
  getResultsList(numResultsToFetch) {
    return $axios.get(`api/v1/Guess/GetResultsList/${numResultsToFetch}`, { baseURL: baseUrl });
  },
  hasUserSubmittedNextGuess(userName) {
    return $axios.get(`api/v1/Guess/HasUserSubmittedNextGuess/${userName}`, { baseURL: baseUrl });
  },
  createGuess(guess) {
    return $axios.post('api/v1/Guess/CreateGuess/', guess, { baseURL: baseUrl });
  },
};
